module div_16bit(
    input [15:0] A,
    input [7:0] B,
    output reg [15:0] result,
    output reg [15:0] odd
);
reg [15:0] a_reg, b_reg;
integer i;

always @(*) begin
    a_reg = A;
    b_reg = B;
    for (i = 0; i < 8; i = i + 1) begin
        if ((a_reg >> (7 - i)) >= b_reg) begin
            result[i] = 1'b1;
            a_reg = (a_reg >> (7 - i)) - b_reg;
        end else begin
            result[i] = 1'b0;
        end
    end
end

always @(*) begin
    odd = a_reg << 8;
end

endmodule

module div_16bit (
    input [15:0] A,
    input [7:0] B,
    output reg [15:0] result,
    output reg [15:0] odd
);

reg [15:0] a_reg;
reg [7:0] b_reg;
wire [16:0] q;

always @(*) begin
    a_reg = A;
    b_reg = B;
end

assign q = (a_reg >> 8) >= b_reg ? 1 : 0;

assign odd = (q == 1) ? (a_reg << 1) - (b_reg << 1) : a_reg << 1;
assign result = (q == 1) ? (a_reg >> 9) | (1 << 7) : a_reg >> 8;

endmodule

